@Realjohndoe: I can't remember exactly how old I was, my first computer was a Macintosh SE.

Black and white tube monitor. 4mb ram. 20 megabyte stepper motor hard drive.
My dad after that got me an IBM PS/2 with 8mb Edo ram. 800 megabyte hard drive and It had a huge 2D / 3d a trident video card and crystal sound card with adlib / sound blaster emulation.
